window.bookSummaryJSON = "<p>A country drive quickly turns into a nightmare for newlyweds Paige and Hal Loche.</p> <p>When you are in the bush, pregnant, and your husband is hurt what do you do? Will you trust just about anyone? When their car gets a flat tire in the Australian outback, it should be a simple job for capable Hal to fix. His wife pregnant, he sets to it. But an accident befalls him, leaving him immobilized. Paige is now their only hope of getting out of the bush.</p> <p>\"How the cruelty of a stranger changes a couple's life forever.\"</p> <p>When Paige chances upon a stranger, it seems her prayers are answered. But the stranger doesn't want to help. She wants something else, and it's not Paige's husband. Hal is expendable, piece by piece it seems, but her baby isn't. What will Paige do to protect her unborn child, and at what price?</p>"; 
